import React from "react"

import Header from "./header"
import Button from "./button"

function App() {
    return (
        <div>
            <Header />
            <ThemeContext.Consumer>
                {theme => (
                    <Button theme={theme} />
                )}
            </ThemeContext.Consumer>

            <Button theme="light" />
        </div>
    )
}

export default App
